import React, { Component } from 'react';
import logo from "./logo.png"

class NavBar extends Component {

  render() {
    return (
      <div className="nav-container">
        <img
          className="logo-container"
          src={logo}
          alt="logo"
        />
      </div>
    );
  }

}

export default NavBar;
